// src/pages/AdminDashboard.js
import React from 'react';
import './AdminDashboard.css'; // Import admin dashboard CSS

const AdminDashboard = () => {
  return (
    <div className="dashboard-container">
      <h1>Admin Dashboard</h1>
      <div className="stats">
        <div className="stat-card">Total Users: 100</div>
        <div className="stat-card">Total Events: 50</div>
      </div>
      <h2>User Management</h2>
      {/* List of users with approve/reject buttons */}
      <ul className="user-list">
        <li>User 1 <button>Approve</button> <button>Reject</button></li>
        <li>User 2 <button>Approve</button> <button>Reject</button></li>
        {/* More users */}
      </ul>
    </div>
  );
};

export default AdminDashboard;
